import React from 'react';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { createTheme } from '@mui/material/styles';
import DescriptionIcon from '@mui/icons-material/Description';
import { AppProvider } from '@toolpad/core/AppProvider';
import { DashboardLayout } from '@toolpad/core/DashboardLayout';
import { useDemoRouter } from '@toolpad/core/internal';

// Create a custom theme for the dashboard
const demoTheme = createTheme({
  cssVariables: {
    colorSchemeSelector: 'data-toolpad-color-scheme',
  },
  colorSchemes: { light: true, dark: true },
  breakpoints: {
    values: {
      xs: 0,
      sm: 600,
      md: 600,
      lg: 1200,
      xl: 1536,
    },
  },
});

// Components for each section
function RequirementsContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Requirements</Typography>
      <Typography>Details about requirements go here.</Typography>
    </Box>
  );
}

function PostContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Post</Typography>
      <Typography>Create and manage your posts here.</Typography>
    </Box>
  );
}

function MyPostsContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">My Posts</Typography>
      <Typography>View your posts here.</Typography>
    </Box>
  );
}

function SubscriptionContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Subscription</Typography>
      <Typography>Manage your subscriptions here.</Typography>
    </Box>
  );
}

function ConnectToShopsContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Connect to Shops</Typography>
      <Typography>Find and connect with shops here.</Typography>
    </Box>
  );
}

function MyConnectionsContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">My Connections</Typography>
      <Typography>Manage your connections here.</Typography>
    </Box>
  );
}

function UpdateProfileContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Update Profile</Typography>
      <Typography>Edit and update your profile here.</Typography>
    </Box>
  );
}

function NotificationsContent() {
  return (
    <Box sx={{ py: 4, textAlign: 'center' }}>
      <Typography variant="h4">Notifications</Typography>
      <Typography>View your notifications here.</Typography>
    </Box>
  );
}

// Page content based on the current route
function DemoPageContent({ pathname }) {
  switch (pathname) {
    case '/requirements':
      return <RequirementsContent />;
    case '/post':
      return <PostContent />;
    case '/myposts':
      return <MyPostsContent />;
    case '/subscription':
      return <SubscriptionContent />;
    case '/connect-to-shops':
      return <ConnectToShopsContent />;
    case '/my-connections':
      return <MyConnectionsContent />;
    case '/update-profile':
      return <UpdateProfileContent />;
    case '/notifications':
      return <NotificationsContent />;
    default:
      return (
        <Box sx={{ py: 4, textAlign: 'center' }}>
          <Typography variant="h4">404</Typography>
          <Typography>Page not found.</Typography>
        </Box>
      );
  }
}

DemoPageContent.propTypes = {
  pathname: PropTypes.string.isRequired,
};

// Navigation and routing
function DashboardLayoutNavigationLinks(props) {
  const { window } = props;
  const router = useDemoRouter(''); // Demo router for navigation

  // Optional: Define a custom window for iframe support
  const demoWindow = window !== undefined ? window() : undefined;

  return (
    <AppProvider
      navigation={[
        {
          segment: 'requirements',
          title: 'Requirements',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'post',
          title: 'Post',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'myposts',
          title: 'My Posts',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'subscription',
          title: 'Subscription',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'connect-to-shops',
          title: 'Connect to Shops',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'my-connections',
          title: 'My Connections',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'update-profile',
          title: 'Update Profile',
          icon: <DescriptionIcon />,
        },
        {
          segment: 'notifications',
          title: 'Notifications',
          icon: <DescriptionIcon />,
        },
      ]}
      router={router}
      theme={demoTheme}
      window={demoWindow}
    >
      <DashboardLayout>
        <DemoPageContent pathname={router.pathname} />
      </DashboardLayout>
    </AppProvider>
  );
}

DashboardLayoutNavigationLinks.propTypes = {
  /**
   * Injected by the documentation to work in an iframe.
   * Remove this when copying and pasting into your project.
   */
  window: PropTypes.func,
};

export default DashboardLayoutNavigationLinks;
